import Elsherouk from './Elsherouk';
import Reservation from './Reservation';

function الملاعب()  {
   
 
   
 
   
      return(
        <div className="الملاعب">
      
           <StarPark/>
          <Sansero/>
          <Sentiago/>
          <Elsherouk/> 
       
             <Reservation/> 
          
         
        
        </div>
    
      ) 
}

export default الملاعب ;
